import React from "react";
import "antd/dist/antd.css";
import styled from "styled-components";

const Wrapper = styled.section`
  width: ${(props) => props.width || "100%"};
`;

const NextBoard = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  );
};

export default NextBoard;
